{
  "presets": ["next/babel"]
}

export default {
  defaultTitle: 'readme.so',
  description: `Use readme.so's markdown editor and templates to easily create a ReadMe for your projects`,
  additionalMetaTags: [
    {
      property: 'keywords',
      content: 'readme, easiest, create, markdown, git, github, gitlab',
    },
    {
      name: 'theme_color',
      content: '#10B981',
    },
  ],
  additionalLinkTags: [
    {
      rel: 'icon',
      href: '/favicon.ico',
    },
    {
      rel: 'apple-touch-icon',
      href: '/icons/icon-96x96.png',
      sizes: '96x96',
    },
    {
      rel: 'manifest',
      href: '/manifest.json',
    },
  ],
  openGraph: {
    type: 'website',
    locale: 'en_US',
    url: 'https://readme.so/',
    title: 'readme.so',
    description: `Use readme.so's markdown editor and templates to easily create a ReadMe for your projects`,
    images: [
      {
        url: 'https://readme.so/readme.png',
        width: 375,
        height: 375,
        alt: 'Og Image Alt',
      },
    ],
    site_name: 'readme.so',
    imageWidth: 1200,
    imageHeight: 1200,
  },
  twitter: {
    handle: '@katherinecodes',
    cardType: 'summary',
  },
}

const { i18n } = require('./next-i18next.config')
const withPWA = require('next-pwa')

module.exports = withPWA({
  i18n,
  webpackDevMiddleware: (config) => {
    config.watchOptions = {
      poll: 1000,
      aggregateTimeout: 300,
    }
    return config
  },
  pwa: {
    dest: 'public',
    disable: process.env.NODE_ENV === 'development',
  },
})

